class CommonConfig {
    pagingOptions = [{
            label: "10 bản ghi trên 1 trang",
            value: 10,
        },
        {
            label: "20 bản ghi trên 1 trang",
            value: 20,
        },
        {
            label: "30 bản ghi trên 1 trang",
            value: 30,
        },
        {
            label: "50 bản ghi trên 1 trang",
            value: 50,
        },
        {
            label: "100 bản ghi trên 1 trang",
            value: 100,
        },
    ];
}
export default new CommonConfig();
